import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header"> YUMMY GED</header>
      <main>
        <ul>
          <li>Science Lessons</li>
          <li>Social Studies Lessons</li>
          <li>Language Arts Lessons</li>
          <li>Math Lessons</li>
        </ul>
      </main>
    </div>
  );
}

export default App;
